import "./Themes.style.css";

const Themes = () => {
  const themes = [
    {
      id: 1,
      main: "#62929e",
      second: "#4a6d7c",
      text: "white",
    },
    {
      id: 2,
      main: "#899878",
      second: "#e4e6c3",
      text: "#95190c",
    },
  ];
  const style = {
    //     height: "50px",
    //     width: "50px",
  };
  return (
    <div className="themes">
      {themes.map((theme) => {
        <div key={theme.id}>
          <div style={{ ...style, backgroundColor: theme.main }}></div>
          <div style={{ ...style, backgroundColor: theme.second }}></div>
        </div>;
      })}
    </div>
  );
};

export default Themes;
